    this._onSaturationMouseUp()
    this._onHueMouseUp()

    this.$saturation.removeEventListener(
      'mousedown',
      this._onSaturationMouseDown
    )
    this.$saturation.removeEventListener(
      'touchstart',
      this._onSaturationMouseDown
    )
